import { Button, HStack } from "@chakra-ui/react";
import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <HStack p={"4"} shadow={"base"} bgColor={"yellow.400"} justifyContent={"center"}>
      <Button variant={"unstyled"} color={"black"} borderRadius={"full"}>
        <Link to="/">Home</Link>
      </Button>
      <Button variant={"unstyled"} color={"black"} borderRadius={"full"}>
        <Link to="/exchanges">Exchanges</Link>
      </Button>
      <Button variant={"unstyled"} color={"black"} borderRadius={"full"}>
        <Link to="/coins">Coins</Link>
      </Button>
    </HStack>
  );
};

export default Header;
